import React, { Component } from 'react';

import {
  Container,
  Navbar,
  NavbarBrand,
  Row,
  Col

} from 'reactstrap';
function App() {
  return (
    <Container fluid className='centered'>
      <Navbar dark color='dark'>
        <NavbarBrand href="/">My React App</NavbarBrand>
      </Navbar>
    </Container>
  );
}


export default App;
